import{_ as e,o as t,c as r,O as o}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 23.1-2407 Public purpose.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2407.md","filePath":"vacode/23.1-2407.md"}'),a={name:"vacode/23.1-2407.md"},i=o('<h1 id="§-23-1-2407-public-purpose" tabindex="-1">§ 23.1-2407 Public purpose. <a class="header-anchor" href="#§-23-1-2407-public-purpose" aria-label="Permalink to &quot;§ 23.1-2407 Public purpose.&quot;">​</a></h1><p>The exercise of the powers granted by this chapter is in all respects for the benefit of the inhabitants of the Commonwealth and the promotion of their safety, health, welfare, knowledge, convenience, and prosperity. No part of the assets or net earnings of the Authority shall inure to the benefit of or be distributable to any private individual, except that reasonable compensation may be paid for services rendered to or for the Authority affecting one or more of its purposes, and benefits may be conferred that are in conformity with its purposes. No private individual is entitled to share in the distribution of any of the corporate assets upon dissolution of the Authority.</p><p>1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0905" target="_blank" rel="noreferrer">905</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1046" target="_blank" rel="noreferrer">1046</a>, § 23-50.16:15; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',3),n=[i];function s(p,c,l,h,f,d){return t(),r("div",null,n)}const b=e(a,[["render",s]]);export{_ as __pageData,b as default};
